import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class NavSub extends Component {
    render() {
        var {item} = this.props;
        return (
            <li className="menu-item">
                <Link>Taolao</Link>
            </li>
        );
    }
}

export default NavSub;
